import styled from 'styled-components';


const OuterBox = styled.div`
  display: flex;
  flex-direction:vertical; 
  justify-content: center;
  align-items: center;
  width: 80%;
  height: 200px;
  margin: 10px auto;
  background-color: #f5f5f5;
  border-radius: 10px;
  box-shadow: 0px 10px 20px rgba(0,0,0,0.19), 0px 6px 6px rgba(0,0,0,0.23);
`;


export {OuterBox}
